import logo from './logo.svg';
import React, { Component } from 'react'
import data from './data'
import './App.css';

class App extends Component {
  render() {
    <h1>Pokedex</h1>
    return data.map((e) => {
      return <div className="wrapper">
        <div className={e.id}>
          <p>{e.name}</p>
          <img src={e.image} alt={e.name}></img>
        </div>
      </div>
    })
  }
}

export default App;

